import { GET_PROFILE, GET_PAYMENT } from '../actions/types';

const initialstate = {
  id: '',
};

export default function (state = initialstate, action) {
  switch (action.type) {
    case GET_PROFILE:
      return {
        id: action.payload,
      };
    case GET_PAYMENT:
      return {
        id: action.payload,
      };
    default:
      return state;
  }
}
